Ellis Dee - 15 May 1992 - Fantazia Summertime, Matcham's Park, Bournemouth.


Legendary final set at the best rave event ever. IMO of course. And yeah, we did all go to Bournemouth.t28d3

&quot;Robbie Dee couldn't get an E tonight, so he found a different way to fly....&quot;

Complete with the signs of being played about a thousand times unfortunately!


------------------------------------------------------------------------

